import './stockCss.css';
function Stock(){
    return(
        <>
            <h1>Dariyalal Electronics</h1>
            <div className='container'>
                <div className='row'>
                    <div className='col'>
                        <table>
                            <tr>
                                <th>Sr. No.</th>
                            </tr>
                        </table>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Stock;
